import React from "react";
import {Link} from "react-router-dom";

const MealItemsList = ({imageTitles}) => {
  return(
    <div className="ui relaxed divided list">
      {imageTitles.map(({image, title}) => {
        return(
          <div className="item">
            <img className="item-icon" src={image} alt="meal menu item"/>
            <h1 className="order-text">
              {title}
            </h1>
          </div>
        );
      })}
    </div>
  );
}

export default MealItemsList;
